def is_prime(n):
    if n == 1:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    for i in range(3, math.isqrt(n) + 1, 2):
        if n % i == 0:
            return False
    return True

def nth_prime(n):
    (count, num) = (0, 1)
    while count < n:
        num += 1
        if is_prime(num):
            count += 1
    return num

def entrance(n):
    N = n ** 3
    a = [i * nth_prime(i) - 1 + i % nth_prime(i) for i in range(1, N + 1)]
    return sum((1 for a_tuple in combinations(a, 5) if is_prime(a_tuple[0] * a_tuple[1] * a_tuple[2] * a_tuple[3] % a_tuple[1])))

